import { useEffect } from "react";

function gameFetch(apiData) {
	console.log("hi");
	apiData.map(game => {Fetcher(game.id)});
	function Fetcher(id){
		console.log(id);
		useEffect(() => {
			const result = fetch("http://127.0.0.1:8000/");
                	const finale = result.json();
                	console.log(finale);
		}, []);
	};
};

export default gameFetch;
